import React from "react";
import Box from "@mui/material/Box";
import LinearProgress from "@mui/material/LinearProgress";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import IconButton from "@mui/material/IconButton";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";

const Progressbar = ({ currentPage, totalPages }) => {
  const progress = (currentPage / totalPages) * 100;
  const theme = createTheme({
    palette: {
      primary: {
        main: "#15a387",
        light: "#E9DB5D",
        dark: "#A29415",
        contrastText: "#242105",
      },
    },
  });
  const customStyles = {
    backgroundColor: "#e5e7eb",
    height: "5px",
    borderRadius: "10px",
    marginTop: "20px",
    marginBottom: "20px",
    marginLeft: "10%",
    marginRight: "10%",
    display: "flex",
    alignItems: "center",
  };

  const handleGoBack = () => {
    // Implement your logic to go back to previous page
    console.log("Going back...");
  };

  return (
    <Box sx={{ width: "80%", marginLeft: "auto", marginRight: "auto" }}>
      <ThemeProvider theme={theme}>
        <div style={{ position: "relative" }}>
          <IconButton
            onClick={handleGoBack}
            style={{ position: "absolute", left: "-40px", top: "-12px" }}
          >
            <ArrowBackIcon />
          </IconButton>
          <LinearProgress
            variant="determinate"
            value={progress}
            sx={{ ...customStyles, color: theme.palette.primary.main }}
          />
        </div>
      </ThemeProvider>
    </Box>
  );
};

export default Progressbar;
